features.script:
let r2 = rocket.createAnimation('rotation')

r2.setKeys([{
  frame: 30,
  value: rocket.rotation.add(new Vector3(0, feature.rotation.y + Math.PI / 2, 0) )
}])

rocket.startAnimations( [r2] ) //Starts the animation

let closed = true

feature.on('click',e=>{

  if(closed){
      feature.rotation.y=0
  }else{
      feature.rotation.y=-1.57

  }
closed=!closed
})

